import "./App.css";
import { Container } from "react-bootstrap";
import {BrowserRouter,Route,Switch} from "react-router-dom"
import TopBar from "./component/Topbar";
import About from "./component/About";

function App() {
  return (
    <>
    <BrowserRouter>
      <TopBar />
      <Switch>
        <Route path="/about" component={About} exact/>
      </Switch>
    </BrowserRouter>
    </>
  );
}

export default App;
